import React from 'react';
import Link from 'next/link';

import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';

export default function NavBar(){

    const useStyles = makeStyles((theme) => ({
        root: {
          flexGrow: 1,
        },
        menuButton: {
          marginRight: theme.spacing(2),
        },
        title: {
          flexGrow: 1,
        },
      }));


    return(
        <>
            <nav className="navbar navbar-expand-lg navbar-light bg-dark text-white" id="navBar">
                <a className="navbar-brand text-white" href="/">Inicio</a>

                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
                </button>

                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul className="navbar-nav mr-auto">
                        <li className="nav-item active">
                            <Link href="/pet">
                                <a className="nav-link" href="#">Mascotas</a>
                            </Link>
                        </li>
                        <li className="nav-item active">
                            <Link href="/user">
                                <a className="nav-link" href="#">Usuarios</a>
                            </Link>
                        </li>
                        <li className="nav-item active">
                            <Link href="/meet">
                                <a className="nav-link" href="#">Turnos</a>
                            </Link>
                        </li>
                        <li className="nav-item active">
                            <Link href ="/drug">
                                <a className="nav-link" href="#">Ventas</a>
                            </Link>
                        </li>
                    </ul>
                </div>
            </nav>
            <div className={classes.root}>
            <AppBar position="static">
                <Toolbar>
                <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
                    <MenuIcon />
                </IconButton>
                <Typography variant="h6" className={classes.title}>
                    News
                </Typography>
                <Button color="inherit">Login</Button>
                </Toolbar>
            </AppBar>
            </div>
        </>
    )

}
